// src/components/CenterCard.tsx
import React from 'react';
import { Card, CardContent, Typography } from '@mui/material';

const CenterCard: React.FC<{ center: any }> = ({ center }) => {
  return (
    <Card className='workspace-card'>
        <img src="e2d0405175f74b5c815658a8ef5ef4b8.jpg"/>
      <CardContent className='workspace-info'>
        <Typography variant="h5">{center.name}</Typography>
        <Typography>{center.description}</Typography>
        
        <div className='pricing'>
        <Typography>{center.day_pass_price}</Typography>
        <Typography>{center.month_pass_price}</Typography>
        </div>
      </CardContent>
    </Card>
  );
};

export default CenterCard;
